DROP DATABASE IF EXISTS `SocialNetworkDB`;
CREATE DATABASE  IF NOT EXISTS `SocialNetworkDB` CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
USE `SocialNetworkDB`;

SET NAMES utf8mb4;

SET FOREIGN_KEY_CHECKS=0;

CREATE TABLE PersonTable(
    UserID    BIGINT NOT NULL UNIQUE AUTO_INCREMENT,
    First_Name    VARCHAR(30) NOT NULL,
    Last_Name    VARCHAR(30),
    CreationDate    DATETIME DEFAULT CURRENT_TIMESTAMP,
    BirthDay    INT,
    BirthMonth    ENUM('January','February','March','April','May','June','July','August','September','October','November','December'),
    BirthYear    INT,
    Gender    ENUM('Male', 'Female', 'Other') DEFAULT 'Other',
    Description    VARCHAR(250) DEFAULT NULL,
    NumberOfFollowers    BIGINT DEFAULT 0,
    PRIMARY KEY (UserID)
) AUTO_INCREMENT = 1 ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE utf8mb4_unicode_ci;

CREATE TABLE PostTable(
    PostID    BIGINT NOT NULL UNIQUE AUTO_INCREMENT,
    Text    VARCHAR(250) DEFAULT NULL,
    Date    DATETIME DEFAULT CURRENT_TIMESTAMP,
    UserID    BIGINT NOT NULL,
    is_retweet    BOOL DEFAULT FALSE,
    is_reply    BOOL DEFAULT FALSE,
    Original_PostID    BIGINT DEFAULT NULL,
    Original_Post_UserID    BIGINT DEFAULT NULL,
    NumberOfLikes    BIGINT DEFAULT 0,
    NumberOfReposts    BIGINT DEFAULT 0,
    PRIMARY KEY (PostID),
    FOREIGN KEY (UserID) REFERENCES PersonTable(UserID),
    FOREIGN KEY (Original_PostID) REFERENCES PostTable(PostID),
    FOREIGN KEY (Original_Post_UserID) REFERENCES PersonTable(UserID)
) AUTO_INCREMENT = 1 ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE utf8mb4_unicode_ci;

CREATE TABLE TopicTable(
    TopicID    VARCHAR(100) BINARY NOT NULL UNIQUE,
    NumberOfFollowers    BIGINT NOT NULL,
    CHECK(NumberOfFollowers >= 0),
    PRIMARY KEY (TopicID)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE utf8mb4_unicode_ci;

CREATE TABLE PersonHandleTable(
    UserID    BIGINT NOT NULL UNIQUE,
    Handle    VARCHAR(100) NOT NULL UNIQUE,
    PRIMARY KEY(UserID),
    FOREIGN KEY (UserID) REFERENCES PersonTable(UserID)
);

CREATE TABLE FollowsPersonTable(
    Following_UserID    BIGINT NOT NULL,
    FollowedBy_UserID    BIGINT NOT NULL,
    CHECK(Following_UserID != FollowedBy_UserID),
    PRIMARY KEY (Following_UserID, FollowedBy_UserID),
    FOREIGN KEY (Following_UserID) REFERENCES PersonTable(UserID),
    FOREIGN KEY (FollowedBy_UserID) REFERENCES PersonTable(UserID)
);

CREATE TABLE PostMediaTable(
    PostID    BIGINT NOT NULL,
    Media_Number    INT NOT NULL,
    Media_URL    VARCHAR(250) NOT NULL,
    CHECK(Media_Number > 0),
    PRIMARY KEY (PostID, Media_Number),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID)
);

CREATE TABLE PostLinksTable(
    PostID    BIGINT NOT NULL,
    Link_Number    INT NOT NULL,
    Link_URL    VARCHAR(250) NOT NULL,
    CHECK(Link_Number > 0),
    PRIMARY KEY (PostID, Link_Number),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID)
);

CREATE TABLE PostPeopleTaggedTable(
    PostID    BIGINT NOT NULL,
    Tag_Number    INT NOT NULL,
    UserID    BIGINT NOT NULL,
    CHECK(Tag_Number > 0),
    PRIMARY KEY (PostID, Tag_Number),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID)
);

CREATE TABLE PostTopicsTable(
    PostID    BIGINT NOT NULL,
    Topic_Number    INT NOT NULL,
    TopicID    VARCHAR(100) BINARY NOT NULL,
    CHECK(Topic_Number > 0),
    PRIMARY KEY (PostID, Topic_Number),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID),
    FOREIGN KEY (TopicID) REFERENCES TopicTable(TopicID)
);

CREATE TABLE LikesPostTable(
    PostID    BIGINT NOT NULL,
    UserID    BIGINT NOT NULL,
    PRIMARY KEY (PostID, UserID),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID),
    FOREIGN KEY (UserID) REFERENCES PersonTable(UserID)
);

CREATE TABLE ReadPostTable(
    PostID    BIGINT NOT NULL,
    UserID    BIGINT NOT NULL,
    PRIMARY KEY (PostID, UserID),
    FOREIGN KEY (PostID) REFERENCES PostTable(PostID),
    FOREIGN KEY (UserID) REFERENCES PersonTable(UserID)
);

CREATE TABLE FollowsTopicTable(
    TopicID    VARCHAR(100) BINARY NOT NULL,
    UserID    BIGINT NOT NULL,
    PRIMARY KEY (TopicID, UserID),
    FOREIGN KEY (TopicID) REFERENCES TopicTable(TopicID),
    FOREIGN KEY (UserID) REFERENCES PersonTable(UserID)
);

ALTER TABLE `PostTable` ADD INDEX `Date`(`Date`);
ALTER TABLE `PostTopicsTable` ADD INDEX `TopicID`(`TopicID`);
ALTER TABLE `PostPeopleTaggedTable` ADD INDEX `UserID`(`UserID`);




